import React, { useState } from "react";
import ReactMapGL from "react-map-gl";



export default function App() {
  const [viewport, setViewport] = useState({
    latitude: 43.641877,
    longitude: -79.386294,
    width: "100vw",
    height: "100vh",
    zoom: 10
  });

  return (
    <div>
      <ReactMapGL {...viewport} mapboxApiAccessToken="pk.eyJ1IjoiYnJpY2V6YWtyYSIsImEiOiJjazJwbmR3bmcwNjRmM25wZ2VmaTM3MHJ0In0.5F4SAt1Rtc-MXzjv6wxWaQ"
      onViewportChange = {viewport => {
        setViewport(viewport);
      }}
      >
     markers here
      </ReactMapGL>

    </div>
  );
}
